import React from 'react';

import '../App.css';

{/* About page */}

function About() {
    return (
        <div>
            <header className="App-font">
                Since 2019, we have been providing users and customers the best
                experience. 
            </header>
            <p className="App-font">
                At ToUpper LLC, we pride and distinguish ourselves by using the most modern technology when it comes to creating mobile or web applications.
                <br></br>we know creating websites aren't here so we're here to help.We help businesses meet their goals by providing elegant and easy to use webpages for their customers.
            </p>
            <p>We know creating a website or mobile application for your business isn't easy, so let us help. 
                Over the years, we have been helping all different kinds of businesses meet their goals. 
                We consult with businesses on what's best for their business. 
                While consulting, we always make sure to provide the most elegant and easy to use interface for your customers.
                </p>
            <p>
                Let the geeks do the work for you! For any questions or comments, please contact us and we will be happy to respond as soon as possible!
            </p>
      </div>
    );
}

export default About;
